const InfoCard = () => {
    return (
      <div className="info-card bg-light p-3 my-4">
        <h5 className="text-center">Addiction Information</h5>
        <p>
          Addiction is a complex condition, a brain disorder that is manifested by compulsive substance use despite harmful consequences.
        </p>
        <p>
          It is characterized by: 
          <ul>
            <li>Inability to stop using a substance</li>
            <li>Failure to meet obligations at work, school, or home</li>
            <li>Continued use despite social or interpersonal problems</li>
          </ul>
        </p>
      </div>
    );
  };
  export default InfoCard;
